var MAX_MATCHES = 100
var fs = require('fs');

function getByteLength(normal_val) {
    // Force string type
    normal_val = String(normal_val);

    var byteLen = 0;
    for (var i = 0; i < normal_val.length; i++) {
        var c = normal_val.charCodeAt(i);
        byteLen +=  c < (1 <<  7) ? 1 :
                c < (1 << 11) ? 2 :
                c < (1 << 16) ? 3 :
                c < (1 << 21) ? 4 :
                c < (1 << 26) ? 5 :
                c < (1 << 31) ? 6 : Number.NaN;
     }
     return byteLen;
} 


function isChinese(ch) {
    var l = ch.length
    var bl = getByteLength(ch)

    return !(l == bl)
}

function get_bsm(input) {
    var result=""
    var found = false
    for(var i=0; i<bsm_table.length; i++) {
        if( bsm_table[i].word == input) {
            var code = bsm_table[i].code
            result = result + code.toUpperCase() + " "
            found = true
        }
    }
   if( found ) {
        return result
   } else {
        return undefined
   }
}


var terminal_cols = process.stdout.columns
var outputed_cols = 0

function output(text) {
//    save_cols(text, outputed_cols)
    process.stdout.write(text)
    outputed_cols = outputed_cols + getByteLength(text)
}

function save_cols(text, cols) {
    fs.appendFile('cols.txt', cols +","+ getByteLength(text) + "," + text.length + ":" + text + "\n", function (err) {
        if (err) throw err;
    });
}

const readline = require('readline');
readline.emitKeypressEvents(process.stdin);
process.stdin.setRawMode(true);
var input = ""
process.stdin.on('keypress', (str, key) => {
        if (key.ctrl && key.name === 'c') {
            console.log("BYE BYE!")
            process.exit();
        } if(key.sequence == "\r") {
            if( input == "" ) {
                return   
            }

            var l = input.length

            if( isChinese(input) ) {
                var s = 3 - l   
            } else { 
                var s = 4 - l
            }

            if( s < 0 ) {
                console.log(": INPUT ERROR!")
                input = ""
            } else {
                output(" ".repeat(s))
                output(": ")
                input = input.toString().trim()
                process_input(input)
                input = ""
                output("\n")
            }

            outputed_cols = 0
        } else {
            output(key.sequence)
            input = input + key.sequence
        }
});


function process_input(input) {
    if( isChinese(input) ) {
        var code = get_bsm(input)
        if( code == undefined ) {
            output("CODE NOT FOUND!")
        } else {
            output(code)
        }
    } else {
        var n=0
        for(var i=0; i<bpm_table.length; i++) {
            if( bpm_table[i].code == input) {
                var code = get_bsm(bpm_table[i].word)
                if( code != undefined ) {
                    var word = bpm_table[i].word
                    var wl = word.length
                    var l = wl + code.length

                    if((outputed_cols + l) > terminal_cols) {
                        process.stdout.write("\n")
                        outputed_cols = 0
                        output(" ".repeat(6))
                    }

                    process.stdout.write("\x1b[32m")
                    output(word)
                    process.stdout.write("\x1b[0m")
                    output(code)
                }
                n++
            }
            if(n == MAX_MATCHES) {
                break
            }
        }
        if(n == 0) {
            output("CODE NOT FOUND!")
        }
    }
}

